import java.io.*;

//================================================
class Table{
	MyStream f;
	
	Table(MyStream f) throws IOException{
		this.f = f;
		f.write('\t');
		f.write("Командна послідовність");
		for(int i = 0; i<5; i++)
			f.write('\t');

		f.write("Шрифт");
		
		f.write('\n');
		
		f.write("Символьна");
		
		f.write('\t');
		f.write('\t');
		f.write('\t');
		
		f.write("Кодова");
		
		f.write('\n');
	}
	
	void nextRow(String s, int [] mas, String s2) throws IOException{
		int [] cancel = {27, 18, 27, 70, 27, 72, 27, 84, 27, 45, 0};
		for(int i : cancel)
			f.write((byte)i);
		
		f.write(s);
		
		for(int i = 0; i<3; i++)
			f.write('\t');
		
		for(int i : mas)
			f.write(((Integer) i).toString()+" ");

		
		int N = 3;
		if(mas.length == 3) N=2;
		for(int i = 0; i<N; i++)
			f.write('\t');
		
		for(int i : mas)
			f.write((byte)i);
		f.write(s2);
		f.write('\n');
	}
}

//-=========================================
class MyStream extends BufferedWriter{
	
	public MyStream(File file) throws FileNotFoundException, UnsupportedEncodingException{
			super(new OutputStreamWriter(new FileOutputStream(file), "cp1251"));
		}
	public void write(String s) throws IOException{
		for(char i : s.toCharArray())
			write(i);
	}
	
	public void writeLine(char ch) throws IOException{
		write((byte)27);
		write((byte)ch);
		write((byte) 105);
		write((byte) 1);
		for(int i = 0; i < 24*15; i++)
			write((byte)240);
		write((byte)20);
		write('\n');
	}
}


